Private Gold 184: Cumshot Christmas  2014

Directed: Alex Conte
Studio: Private

Cast: Alexis Crystal, Jenny Simons, Samantha Johnson, Billie Star, Anna Rose

Private's Christmas movie delivers five fresh stunning scenes that prove it is often as good to receive as it is to give!
Featuring a naughty step-daughter hungry for a load of Christmas spirit, a black tree deliveryman with a big package,
a company celebration dinner where stuffing is on the menu, a shopping trip where the staff understand full service,
and a cuckold husband who gives his wife a man who can make her Christmas very merry indeed.
With Private Christmas comes more than once a year. Happy Holidays!


